import React,{Component} from 'react';
import myPic2 from './myPic2.jpg';
import Resume from '../Resume.pdf';

export default class LandingPage extends Component{
    render(){
        return(
            <div className="landing-page" id="landing" style={{width:'100%',margin:'0px'}}>
            <img className="myPic2" src={myPic2} alt="mypic" /><br /><br />
                <p className="resume-text"><a href={Resume} style={{color:'black'}} target="blank">VIEW RESUME</a></p>
            </div>
        )
    }
}
